{
  "ubx_messages": [
    {
      "name": "UBX-NAV-TIMEGPS",
      "class_id": "0x01",
      "message_id": "0x20",
      "message_type": "periodic_polled",
      "description": "This message reports the precise GPS time of the most recent navigation solution including validity flags and an accuracy estimate.",
      "payload_length": {
        "fixed": 16
      },
      "fields": [
        {
          "byte_offset": 0,
          "data_type": "U4",
          "name": "iTOW",
          "unit": "ms",
          "description": "GPS time of week of the navigation epoch. See section iTOW timestamps in the integration manual for details."
        },
        {
          "byte_offset": 4,
          "data_type": "I4",
          "name": "fTOW",
          "unit": "ns",
          "description": "Fractional part of iTOW (range: +/-500000). The precise GPS time of week in seconds is: (iTOW * 1e-3) + (fTOW * 1e-9)"
        },
        {
          "byte_offset": 8,
          "data_type": "I2",
          "name": "week",
          "description": "GPS week number of the navigation epoch"
        },
        {
          "byte_offset": 10,
          "data_type": "I1",
          "name": "leaps",
          "unit": "S",
          "description": "GPS leap seconds (GPS-UTC)"
        },
        {
          "byte_offset": 11,
          "data_type": "X1",
          "name": "valid",
          "description": "Validity Flags",
          "bitfields": [
            {
              "bit_offset": 0,
              "num_bits": 1,
              "data_type": "U1",
              "name": "towValid",
              "description": "1 = Valid GPS time of week (iTOW & fTOW, (see section Time validity in the integration manual for details)"
            },
            {
              "bit_offset": 1,
              "num_bits": 1,
              "data_type": "U1",
              "name": "weekValid",
              "description": "1 = Valid GPS week number (see section Time validity in the integration manual for details)"
            },
            {
              "bit_offset": 2,
              "num_bits": 1,
              "data_type": "U1",
              "name": "leapSValid",
              "description": "1 = Valid GPS leap seconds"
            }
          ]
        },
        {
          "byte_offset": 12,
          "data_type": "U4",
          "name": "tAcc",
          "unit": "ns",
          "description": "Time Accuracy Estimate"
        }
      ]
    }
  ]
}
